script: |
  super -f text -I q2390.spq | sort > q2390.out

inputs:
  - name: q2390.spq
    data: |
      SELECT DISTINCT col1 * + cor0.col2 / col2 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE ( col0 * - col0 ) NOT IN ( col0 * col2 * cor0.col0 );
  - name: tab0

outputs:
  - name: q2390.out
    data: |
      86
      91
      97
